import React from "react";

export default function Landingpage() {
  return (
        <div className="section1">
            <h3 className="h3Landingpage">Skäm bort din bil</h3>
            <p className="pLandingpage">Bilvård kan vara svårt att förstå därför här vi här för att under lätta det</p>
        </div>

  );
}
